export const addUserItem = async user => {
  try {
    const response = await axios.post(`${BASE_URL}/cadastro`, user);
    const newUserItem = response.data;

    console.log(`Added a new User!`, newUserItem);

    return newUserItem;
  } catch (errors) {
    console.error(errors);
  }
};
